

DROP TABLE if EXISTS file;
DROP SEQUENCE if EXISTS file_id_seq;
CREATE SEQUENCE file_id_seq
    START WITH 2
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
CREATE TABLE file (
    id INTEGER PRIMARY KEY NOT NULL DEFAULT nextval('file_id_seq'),
    title VARCHAR,
    type VARCHAR,
    pub_date DATE,
    owner_id INTEGER,
    data bytea
);


DROP TABLE if EXISTS "user";
DROP SEQUENCE if EXISTS user_id_seq;
CREATE SEQUENCE user_id_seq
    START WITH 2
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;
CREATE TABLE "user" (
    id INTEGER PRIMARY KEY NOT NULL DEFAULT nextval('user_id_seq'),
    username VARCHAR UNIQUE,
    password VARCHAR
);

